<!DOCTYPE html>
<html>
  <head>

    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>

    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };

  <body>
    <div id="base" class="">

      <!-- Unnamed (登录首页) -->

      <!-- Unnamed (Image) -->
      <div id="u1" class="ax_default image">
        <img id="u1_img" class="img " src="images/登录首页/u1.png"/>
      </div>

      <!-- Set Frame Target (Inline Frame) -->
      <div id="u2" class="ax_default" data-label="Set Frame Target">
        <iframe id="u2_input" data-label="Set Frame Target" scrolling="no" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>
      </div>

      <!-- Unnamed (Image) -->
      <div id="u3" class="ax_default _图片">
        <img id="u3_img" class="img " src="images/登录首页/u3.jpg"/>
      </div>

      <!-- Unnamed (Group) -->
      <div id="u4" class="ax_default" data-left="372" data-top="831" data-width="300" data-height="47">

        <!-- Unnamed (HTML Button) -->
        <div id="u5" class="ax_default html_button">
          <input id="u5_input" type="submit" value="登录"/>
        </div>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u6" class="ax_default _三级标题">
        <div id="u6_div" class=""></div>
        <div id="u6_text" class="text ">
          <p><span>没有帐号？立即注册</span></p>
        </div>
      </div>

      <!-- Unnamed (Dynamic Panel) -->
      <div id="u7" class="ax_default">
        <div id="u7_state0" class="panel_state" data-label="Text Field" style="">
          <div id="u7_state0_content" class="panel_state_content">

            <!-- Unnamed (Image) -->
            <div id="u8" class="ax_default image">
              <img id="u8_img" class="img " src="images/登录首页/u8.jpg"/>
            </div>
          </div>
        </div>
      </div>

      <!-- Unnamed (Dynamic Panel) -->
      <div id="u9" class="ax_default">
        <div id="u9_state0" class="panel_state" data-label="Text Field" style="">

            <!-- Unnamed (Image) -->
            <div id="u10" class="ax_default image">
              <img id="u10_img" class="img " src="images/登录首页/u10.jpg"/>
            </div>
          </div>
        </div>
      </div>

      <!-- Unnamed (Status Bar) -->

      <!-- Status Bar (Dynamic Panel) -->
      <div id="u12" class="ax_default" data-label="Status Bar">
        <div id="u12_state0" class="panel_state" data-label="Status Bar" style="">
          <div id="u12_state0_content" class="panel_state_content">

            <!-- Status BG Color (Rectangle) -->
            <div id="u13" class="ax_default _形状" data-label="Status BG Color">
              <img id="u13_img" class="img " src="images/登录首页/status_bg_color_u13.png"/>
            </div>

            <!-- Time (Rectangle) -->
            <div id="u14" class="ax_default _一级标题" data-label="Time">
              <div id="u14_div" class=""></div>
              <div id="u14_text" class="text ">
                <p><span style="font-family:'Roboto Bold', 'Roboto Regular', 'Roboto';font-weight:700;">1:45</span></p>
              </div>
            </div>

            <!-- Status Battery Icon (Image) -->
            <div id="u15" class="ax_default _图片" data-label="Status Battery Icon">
              <img id="u15_img" class="img " src="images/登录首页/status_battery_icon_u15.png"/>

            <!-- Status Wifi Icon (Image) -->

            <div id="u17" class="ax_default _图片" data-label="Status Network Icon">

            <!-- Time (Rectangle) -->
            <div id="u18" class="ax_default _一级标题" data-label="Time">
              <div id="u18_div" class=""></div>
              <div id="u18_text" class="text ">
                <p><span style="font-family:'Roboto Bold', 'Roboto Regular', 'Roboto';font-weight:700;">1:45</span></p>
              </div>
            </div>
          </div>
        </div>
      </div>

      <!-- 手机号文本 (Text Field) -->
      <div id="u19" class="ax_default text_field" data-label="手机号文本" title="手机号">
        <input id="u19_input" type="number" value="" title="手机号" maxlength="11"/>

      <!-- 密码文本 (Text Field) -->
      <div id="u20" class="ax_default text_field" data-label="密码文本">
        <input id="u20_input" type="password" value="" maxlength="6"/>
